import './Navbar.css';
import React from 'react'
import { NavLink } from 'react-router-dom'

function Navbar() {
  return (
    <nav>
        <NavLink to='/'>Home</NavLink>
        <NavLink to='/products/:id'>Product</NavLink>
    </nav>
  )
}

export default Navbar
